const
    path = require("path"),
    fs = require("fs"),
    Store = require('./store.js'),
    crypto = require('crypto'),
    mm = require('music-metadata');

class Music {
    constructor(options = {}) {
        this.main = options.main;
        this.music_data = new Store({
            configName: 'music-data-store',
            defaults: {
                tracks: {},
                folters_hash: {}
            }
        });
        this.sounds = [];
    }

    init() {
    }

    getSounds() {
        return this.sounds;
    }

    removeFolter(folter){
        const readPath = (path_location) => {
            fs.readdir(path_location, (err, files) => {
                if (err) {
                    console.log(err);
                } else {
                    for (let i = 0; i < files.length; i++) {
                        fs.stat(`${path_location}\\${files[i]}`, (err, stats) => {
                            if (err) {
                                console.log(err);
                            } else {
                                if (stats.isDirectory()) {
                                    readPath(`${path_location}\\${files[i]}`);
                                } else if (files[i].split(".").pop() === 'mp3') {
                                    const folterHash = crypto.createHmac('sha256', "s-p-a-c-e-t-r-i-p").update((stats.dev + stats.ino).toString()).digest('hex');
                                    this.sounds = this.sounds.filter(s => s.id !== folterHash);
                                }
                            }
                        });
                    }
                }
            });
        }
        readPath(folter);
    }

    updateSounds(folter = null) {
        console.log('Update sounds...');
        const blocked_icons = [
            "data:image/png;base64,"
        ]

        const readPath = (path_location) => {
            fs.readdir(path_location, (err, files) => {
                if (err) {
                    console.log(err);
                } else {
                    let musicData = this.music_data.get('tracks');
                    for (let i = 0; i < files.length; i++) {
                        fs.stat(`${path_location}\\${files[i]}`, (err, stats) => {
                            if (err) {
                                console.log(err);
                            } else {
                                if (stats.isDirectory()) {
                                    readPath(`${path_location}\\${files[i]}`);
                                } else if (files[i].split(".").pop() === 'mp3') {
                                    mm.parseFile(`${path_location}\\${files[i]}`).then(metadata => {
                                        const folterHash = crypto.createHmac('sha256', "s-p-a-c-e-t-r-i-p").update((stats.dev + stats.ino).toString()).digest('hex');
                                        let has = this.sounds.find(s => s.id === folterHash);
                                        if(has) return;
                                        const
                                            title = metadata.common.title ? metadata.common.title : files[i].substring(0, files[i].length - 4),
                                            authors = metadata.common.artists ? metadata.common.artists.join(', ') : '',
                                            icon_url = metadata.common.picture ? `data:${metadata.common.picture[0].format};base64,${metadata.common.picture[0].data.toString('base64')}` : "",
                                            regex = /^[A-z0-9-]{11}$/gm;
                                        //Теперь нужно создать идеальную модель для трека
                                        //10-04-2022 - нас наебали.
                                        this.sounds.push(
                                            {
                                                path: `${path_location}\\${files[i]}`, //Путь к файлу mp3 (стандарт)
                                                title: musicData[folterHash] ? musicData[folterHash].customTitle ? musicData[folterHash].customTitle : title : title, //Основное
                                                authors: authors, //Основное
                                                meta: { //Тут теги. По сути можно использовать и в веб версии
                                                    lossless: metadata.format.lossless, //Сжато с потерями или нет
                                                    numberOfChannels: metadata.format.numberOfChannels, //Кол-во каналов
                                                    bitrate: metadata.format.bitrate,
                                                    maybe_youtube: regex.test(title),
                                                    listenings: musicData[folterHash] ? musicData[folterHash].listenings ? musicData[folterHash].listenings : 0 : 0,
                                                    seeked_listenings: musicData[folterHash] ? musicData[folterHash].seeked_listenings ? musicData[folterHash].seeked_listenings : 0 : 0
                                                },
                                                //Изображение
                                                picture: metadata.common.picture ? blocked_icons.includes(icon_url) ? "https://servokio.ru/api4/mmd5.svg?md5=" + title + " " + authors : icon_url : "https://servokio.ru/api4/mmd5.svg?md5=" + title + " " + authors,
                                                id: folterHash
                                            }
                                        );
                                        this.sounds.sort((a, b) => (b.meta.listenings + b.meta.seeked_listenings) - (a.meta.listenings + a.meta.seeked_listenings));
                                    })
                                }
                            }
                        });
                    }
                }
            });
        }
        if(folter === null){
            this.main.local_data.get('music_search_in_folders').forEach(folter => readPath(folter));
        } else readPath(folter);
    }
}

module.exports = Music;